import React from 'react';
import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom';
import ExchangeData from './components/ExchangeData';
import MetadataData from './components/MetadataData';
import CandleData from './components/CandleData';

function App() {
  return (
    <Router>
      <div className="min-h-screen bg-gray-100 text-gray-800">
        {/* Navigation Bar */}
        <nav className="bg-blue-600 p-4 shadow-md">
          <ul className="flex justify-center space-x-6">
            <li>
              <Link
                to="/exchange"
                className="text-white font-semibold hover:underline hover:text-gray-200"
              >
                Exchange Data
              </Link>
            </li>
            <li>
              <Link
                to="/metadata"
                className="text-white font-semibold hover:underline hover:text-gray-200"
              >
                Metadata Data
              </Link>
            </li>
            <li>
              <Link
                to="/candle"
                className="text-white font-semibold hover:underline hover:text-gray-200"
              >
                Candle Data
              </Link>
            </li>
          </ul>
        </nav>

        {/* Page Content */}
        <div className="container mx-auto p-6">
          <Routes>
            <Route path="/exchange" element={<ExchangeData />} />
            <Route path="/metadata" element={<MetadataData />} />
            <Route path="/candle" element={<CandleData />} />
            <Route
              path="/"
              element={<div className="text-center text-xl">Welcome to the Data App!</div>}
            />
            <Route
              path="*"
              element={<div className="text-center text-red-500 text-xl">404: Page Not Found</div>}
            />
          </Routes>
        </div>
      </div>
    </Router>
  );
}

export default App;
